- input: "TEXT\x1CC00341750\x1CSA17A.4100.TEXT\x1CSA17A.4100\x1CSA17A\x1CI received
    and deposited a personal international moneygram on 07/07/2008.  However, my bank
    decided to not let the check clear about two weeks later.  They said they believed
    the moneygram and check was perhaps counterfeit.  During the past four months
    Bank of Amerca refused to cash over $8000.00 in moneygrams and money orders.  So,
    I am not sure if I was being discriminated against or not?  The reason is I had
    overheard a malicious rumor incinuating I was perhaps receiving drug money or
    something.  I also will like to mention I have not been involved in any form of
    criminal behavior or illegal drug use!  Furthermore, I perceive I am being discriminated
    against by the remaining Presidential Candidates because I know the United States
    Supreme Court had ruled that it is unconstitutional to campaign as a set of identical
    twins based on a conflict of interest.  And, it is obvious the remaining candidates
    are being televised at several live locations on commercial television. And, they
    don't like me knowing it.  Note: The United States Supreme Court had said that
    just because two people look alike in all respects, whether male or female, it
    does not mean they share the same interests, concerns, or intent as one or the
    other. Thereby it is ruled as a conflict of interest and unconstitutional to campaign
    as a set of idetical twins.  P.S  I will probably be filing as inactive during
    the next month or two"
